import React from 'react';
import {LineStage, Step} from './styles';

function StageComponent() { 
  return (
    <LineStage>
        <Step>Cart</Step>
        <Step>Payment options</Step>
        <Step>Receipt</Step>
    </LineStage>
  );
}
export default StageComponent;
